import { Chat } from './adaptable-zone';

import { BrowserRouter as Router, Route, Switch } from 'react-router-dom'


function App() {
  return (
	<React.Fragment>
		{/**

		<div>
			<header className="Header">
				baniere + avatar-zone
			</header>
		</div>
		<div className='Menu'>
			<OurMenu/>
		</div>
		*/}
		<div className='Adaptable'>

			<Router>
				<Switch>
					<Route exact path="/">
						<Home />
					</Route>
					<Route path="/chat">
						<Chat />
					</Route>
				</Switch>
			</Router>
		</div>
	</React.Fragment>

  );
}

export default App;
